import React from 'react';

const Navbar = () => {
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <h2 class="ms-3" href="#">Counter-App</h2>
            <span class="badge bg-primary ms-1 align-start">1</span>
        </nav >
    );
}

export default Navbar;
